import React from 'react';

function Quickplay(props) {
  const { profile } = props;
  // const quick = profile.quickPlayStats.careerStats.allHeroes;
  console.log(profile.quickPlayStats.awards)

  if (profile.length === 0) {
    return null;
  } else if (profile.private === true) {
    return <h1>This profile is private</h1>;
  }
  return (
    <div className="Quickplay">
      <h1>Quickplay Stats</h1>
      <div className="best">
        <h2>Best</h2>
        <ul>
          {/* <li>All Damage Done Most In Game: {quick.best.allDamageDoneMostInGame}</li> */}
        </ul>
      </div>
    </div>
  );
}

export default Quickplay;
